const RangeFilters = ({options}) => {
    return (
        <div>
            {options.map((option) => {
                return (
                    <div>
                    <div className="range-filter">
                        <input type="checkbox" />
                        <p>{option}</p>
                    </div>
                    <div className="a"></div>
                    </div>
                )
            })}
        </div>
    )
}

export default RangeFilters
